(98,1,"2019-05-11 15:10:37","2019-05-11 15:10:37","<span class=\"mceItemHidden\">This 3 month-long web development boot camp was my first real encounter with web development and PHP.</span>\n\n<span class=\"mceItemHidden\">We learned PHP, MySQL, HTML and Bootstrap through combination of practical hands-on approach and theoretical knowledge.</span>\n<p id=\"tw-target-text\" class=\"tw-data-text tw-ta tw-text-large\" dir=\"ltr\" data-placeholder=\"Prijevod\">Enrollment to this course was definitely one of my smarter decisions in life that paid of with great dividends.</p>\n<p dir=\"ltr\" data-placeholder=\"Prijevod\">You can link to the github repo for the final project</p>","PHP boot camp","Algebra","inherit","closed","closed","","80-autosave-v1","","","2019-05-11 15:10:37","2019-05-11 15:10:37","",80,"http://petar-coric.local/80-autosave-v1/",0,"revision","",0),
(99,1,"2019-05-11 15:27:04","2019-05-11 15:27:04","After finishing my web development boot camp I was determined to expand my coding skills and knowledge, while searching for a job in the field.\r\n\r\nBesides all the personal projects I\'ve made in the time (most of them can be found on my Github profile), I\'ve done plenty of online reading (Stack Overflow etc..), read Code Complete and watched a lot of lectures on Laracasts.","Self education","","publish","closed","closed","","self-education","","","2019-05-11 15:27:04","2019-05-11 15:27:04","",0,"http://petar-coric.local/?post_type=event&#038;p=99",0,"event","",0),
(100,1,"2019-05-11 15:40:47","2019-05-11 15:40:47","After months of self-education I\'ve been given the opportunity to showcase and develop my coding skills in commercial environment.\r\n\r\nDuring the time I worked from home on a few sites for mostly local tourist boards.\r\n\r\nMy roles were mostly creating CRUD features for new fields in the admin dashboard of the sites, minor changes/bug fixes to front end templates etc...","Junior remote Laravel developer","Elipsa computer activites","publish","closed","closed","","junior-remote-laravel-developer","","","2019-05-11 15:40:47","2019-05-11 15:40:47","",0,"http://petar-coric.local/?post_type=event&#038;p=100",0,"event","",0),
(101,1,"2019-05-11 15:55:15","2019-05-11 15:55:15","<span class=\"mceItemHidden\">Remote work I\'ve done had shown me that if I\'m going to do any serious commercial work as a backend web developer, I would need to improve my JavaScript/jQuery skills.</span>\r\n\r\nAs I had good experience with my first boot camp, I\'ve decided to enroll to another one.\r\n\r\n<span class=\"mceItemHidden\">This time it was for the front end technologies, mostly HTML, CSS , JavaScript/jQuery and Bootstrap.</span>\r\n\r\n<span class=\"mceItemHidden\">While frond end work is not really my coup of tea, learning JavaScript, especially ajax, has helped me greatly for any back-end work I do because it expanded my coding toolbox greatly.</span>\r\n\r\n<span class=\"mceItemHidden\">You can find the link to the <span class=\"hiddenSpellError\">github</span> repo for the <span class=\"hiddenSuggestion\">final</span> project bellow.</span>","Fronted boot camp","Algebra","publish","closed","closed","","fronted-boot-camp","","","2019-05-11 15:55:15","2019-05-11 15:55:15","",0,"http://petar-coric.local/?post_type=event&#038;p=101",0,"event","",0),
